function makeCard() {
  series.map(perCard => {
    return(
      <Card
        imgsrc={ perCard.imgsrc }
        title={ perCard.title }
        Sname={ perCard.Sname }
        link={ perCard.link }
      />
    );
  })
}


ReactDOM.render(
  <>
    <div className="heading">Best Series on Netflix and Amazon</div>
    <div className="cardContainer">
    {makeCard}

    </div>
  </>,
  document.getElementById("root")
);
